import React , {useEffect} from 'react'
import axios from 'axios'
import { Link , useHistory} from 'react-router-dom'

const NewHome = () => {
  const history = useHistory();

  const logout = () => {
    setLoginStatus(null);
    axios.get("http://localhost:5000/api/logout").then((response)=>{
      response.data.loggedIn = false 
    });
    history.push('/login')
  }
  axios.defaults.withCredentials = true;

  useEffect(()=>{
    axios.get("http://localhost:5000/api/login").then((response)=>{
      console.log(response);
    })
  }, [])
  return (
    <div><div>
    <div style={{
      backgroundColor: "#019B79",
      color: "white",
      paddingTop: "10px"
    }}>
    <h1 style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}} >Workflow Management System</h1>
    <nav style={{
      color: "Yellow",
      alignContent: "center",
      textAlign:"center"
    }}>
    <Link style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}} to="/"> Home </Link>
    <Link style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}} to="/board"> Board </Link>
    <Link style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}} to="/signup"> Signup </Link>
    <Link style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}} to="/login"> Login </Link>
    <button style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}} onClick={logout}> Logout </button>
         </nav>
  <h3 style={{marginLeft: "20px",marginRight: "20px",fontWeight: "bold"}}>User: {loginStatus}</h3>
  </div>
  </div>
  </div>
  )
}

export default NewHome
